import React, {Component} from 'react';
import {connect} from "react-redux";


import { Table, Tag, Space } from 'antd';


const columns = [
    {
        title: '社团名称',
        dataIndex: 'name',
        key: 'name',
        render: text => <a>{text}</a>,
    },
    {
        title: 'Age',
        dataIndex: 'age',
        key: 'age',
    },
    {
        title: 'Address',
        dataIndex: 'address',
        key: 'address',
    },
    {
        title: 'Tags',
        key: 'tags',
        dataIndex: 'tags',
        render: tags => (
            <span>
        {tags.map(tag => {
            let color = tag.length > 5 ? 'geekblue' : 'green';
            if (tag === 'loser') {
                color = 'volcano';
            }
            return (
                <Tag color={color} key={tag}>
                    {tag.toUpperCase()}
                </Tag>
            );
        })}
      </span>
        ),
    },
    {
        title: '操作',
        key: 'manage',
        render: () => (
            <Space size="middle">
                <a>修改</a>
                <a>删除</a>
            </Space>
        ),
    },
];

const data = [
    {
        key: '1',
        name: 'John Brown',
        age: 32,
        address: 'New York No. 1 Lake Park',
        tags: ['nice', 'developer'],
    },
    {
        key: '2',
        name: 'Jim Green',
        age: 42,
        address: 'London No. 1 Lake Park',
        tags: ['loser'],
    },
    {
        key: '3',
        name: 'Joe Black',
        age: 32,
        address: 'Sidney No. 1 Lake Park',
        tags: ['cool', 'teacher'],
    },
];



class Community extends Component {



    render() {
        return(
            <div className="communityList">

                <Table
                    columns={columns}
                    pagination={{ position: [ 'bottomCenter'] }}
                    dataSource={data}
                />

            </div>
        )
    }
}
const mapState = (state) => ({
    //loginState: state.getIn(['login','loginState'])
});
const mapDispatch = (dispatch) => ({
    // handleLogin(values){
    //     console.log(values);
    //     dispatch(actionCreators.loginRequest(values));
    // }

})

export default connect(mapState,mapDispatch)(Community);
